import React from 'react';
import {
  ScrollView, ImageBackground, View, Text,
} from 'react-native';
import styles from './CharacterListStyles';
import absalomBackground from '../../images/absalom-background.png';

function CharacterList() {
  return (
    <ImageBackground source={absalomBackground}>

      <View style={styles.container}>
        <Text>CharacterList component</Text>
      </View>
    </ImageBackground>
  );
}

export default CharacterList;
